  border-radius: inherit;
  iframe, object, embed {
    width: 100%;
    height: 100%; } }
.q-virtual-scroll {
  &:focus {
    outline: none; }
  &__padding {

    background: linear-gradient(transparent, transparent 20%, rgba(128, 128, 128, .03) 20%, rgba(128, 128, 128, .08) 50%, rgba(128, 128, 128, .03) 80%, transparent 80%, transparent);
    background-size: 100% 50px;
    .q-table & {
      tr {
        height: 0 !important; }
      td {
        padding: 0 !important; } } }
  &--horizontal {
    display: flex;
    flex-direction: row;
    flex-wrap: nowrap;
    align-items: stretch;
    .q-virtual-scroll {
      &__content {
        display: flex;
        flex-direction: row;
        flex-wrap: nowrap; }
      &__padding,
      &__content,
      &__content > * {
        flex: 0 0 auto; }
      &__padding {

        background: linear-gradient(to left, transparent, transparent 20%, rgba(128, 128, 128, .03) 20%, rgba(128, 128, 128, .08) 50%, rgba(128, 128, 128, .03) 80%, transparent 80%, transparent);
        background-size: 50px 100%; } } } }
.q-ripple {
  position: absolute;
  top: 0;
  left: 0 /* rtl:ignore */;
  width: 100%;
  height: 100%;
  color: inherit;
  border-radius: inherit;
  z-index: 0;
  pointer-events: none;
  overflow: hidden;
  contain: strict;
  &__inner {
    position: absolute;
    top: 0;
    left: 0 /* rtl:ignore */;
    opacity: 0;
    color: inherit;
    border-radius: 50%;
    background: currentColor;
    pointer-events: none;
    will-change: transform, opacity;
    &--enter {
      transition: transform .225s cubic-bezier(.4, 0, .2, 1), opacity .1s cubic-bezier(.4, 0, .2, 1); }
    &--leave {
      transition: opacity .25s cubic-bezier(.4, 0, .2, 1); } } }
.q-body--loading {
  overflow: hidden; }
.q-loading {
  color: #000;

  position: fixed !important;
  &:before {
    content: '';
    position: fixed;
    top: 0;
    right: 0;
    bottom: 0;
    left: 0;
    background: currentColor;
    opacity: .5;
    z-index: -1; }
  > div {
    margin: 40px 20px 0;
    max-width: 450px;
    text-align: center; } }
.q-notifications__list {
  z-index: $z-notify;
  pointer-events: none;
  left: 0;
  right: 0;
  margin-bottom: 10px;
  position: relative;
  &--center {
    top: 0;
    bottom: 0; }
  &--top {
    top: 0; }
  &--bottom {
    bottom: 0; } }
body.q-ios-padding .q-notifications__list {
  &--center, &--top {
    top: $ios-statusbar-height;
    top: env(safe-area-inset-top); }
  &--center, &--bottom {
    bottom: env(safe-area-inset-bottom); } }
.q-notification {
  box-shadow: $shadow-2;
  border-radius: $generic-border-radius;
  pointer-events: all;
  display: inline-flex;
  margin: 10px 10px 0;
  transition: transform 1s, opacity 1s;
  z-index: $z-notify;
  min-width: 300px;
  max-width: 95vw;
  background: #323232;
  color: #fff;
  font-size: 14px;
  &__icon {
    font-size: 24px;
    padding-right: 16px; }
  &__avatar {
    font-size: 32px;
    padding-right: 8px; }
  &__message {
    padding: 8px 0; }
  &__actions {
    color: #c581ff; }
  &--standard {
    padding: 0 16px;
    min-height: 48px;
    .q-notification__actions {
      padding: 6px 0 6px 8px;
      margin-right: -8px; } }
  &--multi-line {
    min-height: 68px;
    padding: 8px 16px;
    .q-notification__actions {
      padding: 0; } }
  &--top-left-enter, &--top-left-leave-to,
  &--top-enter, &--top-leave-to,
  &--top-right-enter, &--top-right-leave-to {
    opacity: 0;
    transform: translateY(-50px);
    z-index: ($z-notify - 1); }
  &--left-enter, &--left-leave-to,
  &--center-enter, &--center-leave-to,
  &--right-enter, &--right-leave-to,
  &--bottom-left-enter, &--bottom-left-leave-to,
  &--bottom-enter, &--bottom-leave-to,
  &--bottom-right-enter, &--bottom-right-leave-to {
    opacity: 0;
    transform: translateY(50px);
    z-index: ($z-notify - 1); }
  &--top-left-leave-active,
  &--top-leave-active,
  &--top-right-leave-active,
  &--left-leave-active,
  &--center-leave-active,
  &--right-leave-active,
  &--bottom-left-leave-active,
  &--bottom-leave-active,
  &--bottom-right-leave-active {
    position: absolute;
    z-index: ($z-notify - 1);
    margin-left: 0;
    margin-right: 0; }
  &--top-leave-active,
  &--center-leave-active {
    top: 0; }
  &--bottom-left-leave-active,
  &--bottom-leave-active,
  &--bottom-right-leave-active {
    bottom: 0; } }
@media (min-width: $breakpoint-sm-min) {
  .q-notification {
    max-width: 65vw; } }
.animated {
  animation-duration: .3s;
  animation-fill-mode: both; }
.animated.infinite {
  animation-iteration-count: infinite; }
.animated.hinge {
  animation-duration: 2s; }
.animated.flipOutX,
.animated.flipOutY,
.animated.bounceIn,
.animated.bounceOut {
  animation-duration: .3s; }
.q-animate--scale {
  animation: q-scale .15s;
  animation-timing-function: cubic-bezier(.25, .8, .25, 1); }
@keyframes q-scale {
  0% {
    transform: scale(1); }
  50% {
    transform: scale(1.04); }
  100% {
    transform: scale(1); } }
.q-animate--fade {
  animation: q-fade .2s /* rtl:ignore */; }
@keyframes q-fade {
  0% {
    opacity: 0; }
  100% {
